import * as actionTypes from './actionType';

export const changeInputValue = (value) => ({
  type: actionTypes.CHANGE_INPUT_VALUE,
  value: e.target.value
})

export const addTodoListItem = () => ({
  type: actionTypes.ADD_TODO,
})
